        'IF (SELECT count(*) FROM sys.sysviews where viewname = ''SELECT_(((TP_BASE)))_AGGLEVEL'') > 0
            DROP VIEW SELECT_(((TP_BASE)))_AGGLEVEL
            BEGIN
                create view
                    SELECT_(((TP_BASE))))_AGGLEVEL(FIRSTDATE_ID,AGGLEVEL,DATE_ID,YEAR_ID,MONTH_ID,DAY_ID,WEEK_ID,WEEKDAY_ID,BUSINESSDAY,TIMELEVEL,TIMELEVELBH,DAYS)
                    as select FIRSTDATE_ID,AGGLEVEL,DATE_ID,YEAR_ID,MONTH_ID,DAY_ID,WEEK_ID,WEEKDAY_ID,BUSINESSDAY,TIMELEVEL,TIMELEVELBH,DAYS from dc.SELECT_AGGLEVEL_TABLE
                    WHERE TIMELEVELBH = ''DAYBH''
            commit
            grant select on SELECT_(((TP_BASE)))_AGGLEVEL to dcbo
        END');
